import{_ as e,o as i,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 54.1-2957.8 Licensure of midwives; requisite training and educational requirements; fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-2957.8.md","filePath":"vacode/54.1-2957.8.md"}'),r={name:"vacode/54.1-2957.8.md"},n=t('<h1 id="§-54-1-2957-8-licensure-of-midwives-requisite-training-and-educational-requirements-fees" tabindex="-1">§ 54.1-2957.8 Licensure of midwives; requisite training and educational requirements; fees. <a class="header-anchor" href="#§-54-1-2957-8-licensure-of-midwives-requisite-training-and-educational-requirements-fees" aria-label="Permalink to &quot;§ 54.1-2957.8 Licensure of midwives; requisite training and educational requirements; fees.&quot;">​</a></h1><p>A. It shall be unlawful for any person to practice midwifery in the Commonwealth or use the title of licensed midwife unless he holds a license issued by the Board. The Board may license an applicant as a midwife after such applicant has submitted evidence satisfactory to the Board that he has obtained the Certified Professional Midwife (CPM) credential pursuant to regulations adopted by the Board and in accordance with the provisions of §§ <a href="http://law.lis.virginia.gov/vacode/54.1-2915/" target="_blank" rel="noreferrer">54.1-2915</a>.</p><p>B. Persons seeking licensure as a midwife shall submit such information as required in the form and manner determined by the Board.</p><p>C. Persons seeking licensure shall pay the required license fee as determined by the Board.</p><p>2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0719" target="_blank" rel="noreferrer">719</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0917" target="_blank" rel="noreferrer">917</a>.</p>',5),s=[n];function o(d,c,l,u,f,h){return i(),a("div",null,s)}const _=e(r,[["render",o]]);export{p as __pageData,_ as default};
